  if (lastchar!='\\' && lastchar!='/') _tcscat_s(rootdir,_T("\\"));

  if (flags==ZIP_HANDLE)
  { 
    DWORD res = SetFilePointer(z,0,0,FILE_CURRENT);
    bool canseek = (res!=0xFFFFFFFF);
    if (!canseek) return ZR_SEEK;
  }
  ZRESULT e; LUFILE *f = lufopen(z,len,flags,&e);
