void TurboAssembler::SubS64(Register dst, Register src1, Register src2) {

  if (CpuFeatures::IsSupported(DISTINCT_OPS)) {
    sgrk(dst, src1, src2);
    return;
  }
  if (dst != src1 && dst != src2) mov(dst, src1);

  if (dst != src1 && dst == src2) {
    Label done;
    lcgr(dst, dst);  
    b(overflow, &done);
    AddS64(dst, src1);  
    bind(&done);
  } else {
    SubS64(dst, src2);
  }
}

