int FindKthMax(int*list, int left, int right, int k) {
	int key = list[left];
	int low = left, high = right;
	while (low < high) {
		while (list[high]>=key&&high > low)
			high--;
		list[low] = list[high];
		while (list[low]<=key&&high>low)
			low++;
		list[high] = list[low];
	}
	list[low] = key;

	int l = right - low + 1;
	if (l == k) 
		return key;
	else if (l < k)

		FindKthMax(list, left, low - 1, k - l);
	else

		FindKthMax(list, low + 1, right, k);
}

