void softmaxLayer(vector<float> &input, vector<float> &output) {
	float sum = 0;
	for(int n = 0; n < input.size(); n++) {
		output.push_back(exp(input[n]));
		sum += output[n];
	}
	for(int n = 0; n < input.size(); n++) {
		output[n] /= sum;
	}
}

