void makeFateTable(vector<int>& table)
{
	bool* isSet = new bool[8]();
	for (int item = 0; item < 256; item++) {

		for (int i = 0, mask = 1; i < 8; i++) {
			isSet[i] = (item & mask) == mask;
			mask *= 2;
		}
		for (int i = 0, mask = 1; i < 8; i++) {

			if (isSet[(i + 4) % 8]) table[item] |= mask;
			mask *= 2;
		}
		for (int i = 0; i < 8; i += 2) 
			if (isSet[i]) {
				isSet[(i + 1) % 8] = true;
				isSet[(i + 7) % 8] = true;
			}
		int transitions = 0;
		for (int i = 0; i < 8; i++) {
			if (isSet[i] != isSet[(i + 1) % 8])
				transitions++;
		}
		if (transitions >= 4) {

			table[item] = 0;
		}
	}
}

