char * SimTed::fixName( const char * fname, const char * extn )
{
   if( fname )
   {

      int len = strlen( fname ) + 1;
      if( extn )
         len += strlen( extn );

      char * retStr = new char[ len ];
      strcpy( retStr, fname );

      char * curr = retStr;


      while( *curr && ( *curr != '.' ) )
         curr++;


      if( extn )
         sprintf( curr, extn );
      else
         *curr = 0;

      return( retStr );         
   }

   return( NULL );
}

