node* remove(node *root, string s, int dep = 0) {
  if (root == nullptr) {
    return nullptr;
  }
  if (dep == (int) s.size()) {
    if (root->isEnd) {
      root->isEnd = false;
    }
    if (isEmpty(root)) {
      delete root;
      root = nullptr;
    }
    return root;
  }
  int idx = s[dep] - 'a';
  root->child[idx] = remove(root->child[idx], s, dep + 1);

  if (isEmpty(root) and !root->isEnd) {
    delete root;
    root = nullptr;
  }
  return root;
}

