  vector<vector<int>> pas;
  vector<int> init {1};
  pas.push_back(init);

  vector<int> pre = pas.front();

  for (int i = 1; i < k; i ++) {
    vector<int> cur {1};
    for (int c = 1; c < i; c ++) {
        cur.push_back(pre[c - 1] + pre[c]);
    }
    cur.push_back(1);

    pre = cur;
    pas.push_back(cur);
  }

  for (int i = 0; i < k; i ++) {
    for (int c = 0; c < pas[i].size(); c ++)
      cout << pas[i][c] << " ";
    cout << "\n";
  }
  return;
}

