		return TRUE;






	if (pMsg->hwnd == NULL && DispatchThreadMessageEx(pMsg))
		return TRUE;


	for (HWND hWnd = pMsg->hwnd; 
		hWnd != NULL && hWnd != m_pMainWnd->GetSafeHwnd(); 
		hWnd = ::GetParent(hWnd))
	{
		CWnd* pWnd = CWnd::FromHandlePermanent(hWnd);

		if (pWnd != NULL)
		{

			if (pWnd->PreTranslateMessage(pMsg))
				return TRUE; 
		}
	}


	return FALSE;       

}

