void dfs(vector<string> &res, string s, int pos)
{
    if (pos == s.size() - 1)
    {
        if (find(res.begin(), res.end(), s) == res.end())
        {
            res.push_back(s); 
        }
        return;
    }
    for (int i = pos; i < s.size(); i++)
    {
        swap(s[i], s[pos]);
        dfs(res, s, pos + 1);
        swap(s[i], s[pos]);
    }
}

