void storeMenu()
{
	bool readyToGoBack = false;

	int currentPge = 1;
	bool nextPge = false;

	while (readyToGoBack == false)
	{
		int choice = showStoreMenuAndGetUserChoice(currentPge, nextPge);

		int totalNumberOfGames = listGame.length();
		int dividedByFive = totalNumberOfGames/5 + (totalNumberOfGames % 5 != 0);

		switch (choice)
		{
			case 'B': {
				readyToGoBack = true;
			} break;
			case 'S': {
				searchMenu();
			} break;
			case 'N': {
			    if(currentPge < dividedByFive){
                    currentPge++;
                    nextPge = true;
			    }else{
			        currentPge = 1;
			    }
			} break;
			case 'P': {
			    if(currentPge > 1){
                    currentPge--;
                    nextPge = false;
			    }else{
			    }
			} break;
			default: {
				int index = choice - '1';

				if (index >= 0 && index < listGame.length()) 
				{
					gameMenu(app.GetStore().games[index]);
				}
			} break;
		}
	}
}

