{
  vector<string> ret;
  typedef string::const_iterator iter;

  iter b = s.begin(), e = s.end();

  while (b != e)
    {
      b = url_beg(b,e);

      if (b!= e)
        {
          iter after = url_end(b,e);

          ret.push_back(string(b,after));
          b = after;

        }
    }
  return ret;  
}

