void col_BCD_solver (double* d, double ** w, double * y, double* s, int N, double rho, int active_col, double lambda, double & PG) {
    double * g = new double [N];
    double * w_half = new double [N];
    double * w_new = new double [N];


    for (int i = 0; i < N; i ++) {
        g[i] = rho * (s[i] + y[i]/rho - 1) + d[i];
    }

    for (int i = 0; i < N; i++) {
        w_half[i] =  w[active_col][i] - g[i] / rho;
    }

    skyline(w_new, w_half, N, lambda);


    PG = 0.0;
    for (int i = 0; i < N; i++) {
        double tmp = w_new[i] - w[active_col][i];
        PG += tmp * tmp;
    }


    for (int i = 0; i < N; i++) {
        s[i] += w_new[i] - w[active_col][i];
    }

    for (int i = 0; i < N; i ++) {
        w[active_col][i] = w_new[i];
    }

    delete[] w_new;
    delete[] w_half;
    delete[] g;
}

int CodeEditor::compute_linenumberarea_width()
{
    if (!linenumberarea_enabled)
        return 0;
    int digits = 1;
    int maxb = qMax(1, blockCount());
    while (maxb >= 10) {
        maxb /= 10;
        digits++;
    }
    int linenumbers_margin;
    if (this->linenumbers_margin)
        linenumbers_margin  = 3+this->fontMetrics().width(QString(digits,'9'));
    else
        linenumbers_margin = 0;
    return linenumbers_margin + this->get_markers_margin();
}

