           sizeof(uint8_t) * BUFFER_SIZE);
    p_filter->recvIndex += BUFFER_SIZE;
    this->buf_read_pos = BUFFER_SIZE;
  }
  else
  {
    for (this->buf_read_pos; this->buf_read_pos < this->read_len;
         this->buf_read_pos++)
    {
      isFrame = byteHandler(buf[this->buf_read_pos]);

      if (isFrame)
      {
        return isFrame;
      }
    }
  }


  return isFrame;
}

